import Layout from "../components/Layout";
import { getSongs } from "../pages/api/index";

class Retrive extends React.Component {
  render() {
    const data = getSongs();

    return (
      <Layout>
        <div>{data}</div>
      </Layout>
    );
  }
}

export default Retrive;
